    if(l && v>=0x80000000) {
        char*s = nrbuf();
        as3_softwarning("integer overflow: %s (converted to Number)", s);
        return setfloat(v);
    }
    if(!l && v>0x7fffffff) {
        char*s = nrbuf();
        as3_softwarning("integer overflow: %s (converted to Number)", s);
        return setfloat(v);
    }

    if(l==3) {
        return setint(-(int)v);
    } else {
        return setint(v);
    }
